Super Kingston Details🍄
My 1st time planning an out of state party and I have you guys to thank! I got to work with the BEST vendors in MICHIGAN to pull off Kingston 3rd Bday! All photos are tagged!! Special thanks to my amazing Planner: @_imadination You were so organized and on top of every detail! What an amazing team you have! The 3D backdrop: @oxdecore @sweettreat_events_ You both are beyond talented and really brought my vision to life! Can't wait to do this again! Bounce house, Ball pit & Kids table: @totcercise Loved all your design elements & attention to detail everything was perfect! Decals: @exclusiveimagery Cake: @lindascakeco I still have no words for how perfect Kingston's cake was!! I was obsessed Ballons: @mklrworld You went over and above on all your designs. Everything was perfection!! Boutique Beverages: @drinklemondazethe The most delicious drinks for everyone! "Build a Bear"Station: @dabdouevents All the kids loved making this and taking home their gift. Marquee Letters: @glow_event_rentals Prints: @foreverprints.llc Flowers: @flowerboutiquedetroit Cookies: @thesugarfix_ Table Box Favors:
@sweetscriptstudio “Super Kingston” Signage: @the_bare_designs Photographer: @oliviawenzelphotography
